import React from 'react';
import './App.css';
import HeaderBar from './header';
import './fruitPage.css';
import {motion} from "framer-motion";

const FruitDango = (prod) => {
    return(
        <div className=''>
            <img src={prod.source}></img>
            <h1>Strawberry Sadness</h1>
        </div>
    );
}


const FruitPage = () => {
    return(
        <div className='fruitpage'>
            <HeaderBar/>
            <FruitDango source='starwberrydango.jpg'/>
        </div>
    );
}

export default FruitPage;
